    "quotes": "\"Funeral Blues\", un poème de W. Hugh Auden cité dans \"4 mariages et 1 enterrement\". Juste magnifique, en VO comme en VF...\r\n\r\n\"Stop all the clocks, cut off the telephone,\r\nPrevent the dog from barking with a juicy bone,\r\nSilence the pianos and with muffled drum\r\nBring out the coffin, let the mourners come.\r\n\r\nLet aeroplanes circle moaning overhead\r\nScribbling in the sky the message He is Dead.\r\nPut crepe bows round the white of the public doves,\r\nLet the traffic policemen wear black cotton gloves.\r\n\r\nHe was my North, my South, my East and West,\r\nMy working week and my Sunday rest,\r\nMy noon, my midnight, my talk, my song;\r\nI that love would last forever : I was wrong.\r\n\r\nThe stars are not wanted now; put out every one,\r\nPack up the moon and dismantle the sun,\r\nPour away the ocean and sweep up the woods;\r\nFor nothing now can ever come to any good.\"\r\n\r\n\r\n\"Arrêtez les pendules, coupez le téléphone,\r\nEmpêchez le chien d'aboyer pour l'os que je lui donne,\r\nFaire taire les pianos et sans roulement de tambour\r\nSortir le cercueil, avant la fin du jour.\r\n\r\nQue les avions qui hurlent au-dehors\r\nDessinent dans le ciel ces trois mots : Il est mort.\r\nNouez des voiles noirs aux colonnes des édifices,\r\nGantez de noir les mains des agents de police.\r\n\r\nIl était mon Nord, mon SUd, mon Est et mon Ouest,\r\nMa semaine de travail, mon dimanche de sieste,\r\nMon midi, mon minuit, ma parole, ma chanson;\r\nJe croyais que l'amour jamais ne finirait... j'avais tort.\r\n\r\nQue les étoiles se retirent, qu'on les balaye,\r\nDémontez la lune et le soleil,\r\nVidez l'océan, arrachez la forêt\r\nCar rien de bon ne peut advenir désormais.\"",
